import React, {Component} from 'react';
import {Container, Row, Col} from 'react-bootstrap'

class Footer extends Component {
    render() {
        return (
            <div>
                <Container>
                    <Row><Col>
                        Copyright &copy
                    </Col></Row>
                    <footer>Footer</footer>
                </Container>
            </div>
        );
    }
}

export default Footer;
